    /*position: fixed;*/
    width: 100%;
    padding: 0;
}

.menu-card:hover {
    position: fixed;
    width: 250px;
    padding: 0;
}
.menu-card:hover .menu-text {
    display: block;
}

.menu {
    padding: 0;
    margin: 0px;
    list-style: none;
    width: 100%;
    
}

.menu__item {
    position: relative;
    padding: 0;
}
.menu__item a:not(:hover){
    justify-content: center;
}

.menu_pick {
    background: #ED7200;
}

.menu__link {
    display: flex;
    flex-wrap: nowrap;
    align-content: center;
    align-items: center;
    justify-content: start;
    width: 100%;
    padding: 10px;
    border: 1px solid #bababa;
    border-top-color: rgba(0, 0, 0, 0);
    text-decoration: none;
    color: #fff;
}

.menu-inner {
    position: absolute;
    background-color: #2b3a42;
    display: none;
}

.menu-text {
    display: none;
    padding-left: 10px;
    width: 100%;
}

.menu__item:hover {
    min-width: 250px;
    cursor: pointer;
    padding-left: 20px;
    background-color: #ED7200;
    transition: .3s;
}

a:hover {
     color:#fff; 
