//Phin bn download hon chnh
let data_widget = widgetContext.data;
let lengData = 0;
let rowMax = 0;
let data_export = [];
let data_head = ["Thi gian"];
for (i = 0; i < data_widget.length; i++) {
    data_head.push(data_widget[i].dataKey.label);
    if(data_widget[i].data.length > lengData){
        lengData = data_widget[i].data.length;
        rowMax = i;
    }
}
data_export.push(data_head);

for (i = 0; i < lengData; i++) {
    let data_row = [];
    data_row.push(timeconver(data_widget[rowMax].data[i][0]));
    for (j = 0; j < data_widget.length; j++) {
        let data_push = 0;
        for (k=0; k < data_widget[j].data.length; k++){
            if (data_widget[j].data[k][0] == data_widget[rowMax].data[i][0]) {
                data_push = data_widget[j].data[k][1];
            }
        }
        data_row.push(data_push);
    }
    data_export.push(data_row);
}

function timeconver(timets) {
    var newdate = new Date(timets);
    var dateStr = newdate.getDate() + "/" + (newdate
            .getMonth() + 1) + "/" + newdate.getFullYear() +
        " " + newdate.getHours() + ":" + newdate
        .getMinutes() + ":" + newdate.getSeconds();
    return dateStr;
}

let wb = XLSX.utils.book_new();
wb.Props = {
    Title: "Kikai",
    Subject: "Data_export"
};

wb.SheetNames.push("Data");

var ws = XLSX.utils.aoa_to_sheet(data_export);
wb.Sheets["Data"] = ws;
var wbout = XLSX.write(wb, {
    bookType: 'xlsx',
    type: 'binary'
});

function s2ab(s) {
    var buf = new ArrayBuffer(s.length);
    var view = new Uint8Array(buf);
    for (var i = 0; i < s.length; i++) view[i] = s
        .charCodeAt(i) & 0xFF;
    return buf;
}

saveAs(new Blob([s2ab(wbout)], {
    type: "application/octet-stream"
}), 'Energy Data export.xlsx');

