let $injector = widgetContext.$scope.$injector;
let customDialog = $injector.get(widgetContext.servicesMap
    .get('customDialog'));
let attributeService = $injector.get(widgetContext
    .servicesMap.get('attributeService'));

openEditEntityDialog();

function openEditEntityDialog() {
    customDialog.customDialog(htmlTemplate,
        EditEntityDialogController).subscribe();
}

function EditEntityDialogController(instance) {
    let vm = instance;

    vm.entityId = entityId;
    vm.entityName = entityName;
    vm.attributes = {};

    vm.editEntityFormGroup = vm.fb.group({
        entityName: [''],
        attributes: vm.fb.group({
            AlarmFlag: [false],
            setDien_day: [{
                value: null,
                disabled: true
            }],
            setKhi_day: [{
                value: null,
                disabled: true
            }],
            setGas_day: [{
                value: null,
                disabled: true
            }],
            setNuoc_day: [{
                value: null,
                disabled: true
            }]
        })
    });

    vm.editEntityFormGroup.get('attributes').get(
            'AlarmFlag').valueChanges
        .subscribe(activate => {
            if (activate) {
                vm.editEntityFormGroup.get('attributes')
                    .get('setDien_day').enable();
                vm.editEntityFormGroup.get('attributes')
                    .get('setKhi_day').enable();
                vm.editEntityFormGroup.get('attributes')
                    .get('setGas_day').enable();
                vm.editEntityFormGroup.get('attributes')
                    .get('setNuoc_day').enable();
            } else {
                vm.editEntityFormGroup.get('attributes')
                    .get('setDien_day').disable();
                vm.editEntityFormGroup.get('attributes')
                    .get('setKhi_day').disable();
                vm.editEntityFormGroup.get('attributes')
                    .get('setGas_day').disable();
                vm.editEntityFormGroup.get('attributes')
                    .get('setNuoc_day').disable();
            }
        });

    getEntityInfo();

    vm.save = function() {
        vm.editEntityFormGroup.markAsPristine();
        saveAttributes(entityId).subscribe(
            function() {
                vm.dialogRef.close(null);
            }
        );
    };

    vm.cancel = function() {
        vm.dialogRef.close(null);
    };

    function getEntityAttributes(attributes) {
        for (var i = 0; i < attributes.length; i++) {
            vm.attributes[attributes[i].key] = attributes[i]
                .value;
        }
    }

    function getEntityInfo() {
        attributeService.getEntityAttributes(entityId,
            'SERVER_SCOPE').subscribe(
            function(attributes) {
                getEntityAttributes(attributes);
                vm.editEntityFormGroup.patchValue({
                    entityName: vm.entityName,
                    attributes: vm.attributes
                });
            }
        );
    }

    function saveAttributes(entityId) {
        let attributes = vm.editEntityFormGroup.get(
            'attributes').value;
        let attributesArray = [];
        for (let key in attributes) {
            if (attributes[key] !== vm.attributes[key]) {
                attributesArray.push({
                    key: key,
                    value: attributes[key]
                });
            }
        }
        if (attributesArray.length > 0) {
            return attributeService.saveEntityAttributes(
                entityId, "SERVER_SCOPE",
                attributesArray);
        } else {
            return widgetContext.rxjs.of([]);
        }
    }
}

